import styled from "styled-components";

export const containerCol = { xs: 16, sm: 11, md: 9, lg: 7, xl: 8 };

export const Container = styled.div`
	width: 100%;
	height: 100vh;

	display: flex;
	flex-direction: column;
	align-items: center;
	margin-top: 100px;
`;

export const WidthImg = styled.img`
	display: block;
	margin: 0;
	max-width: 100%;
	min-width: 100%;
	height: auto;
`;
